import './App.css';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div>
      <Routes>
        <Route exact path='/' element={<LoginPage />} />
        <Route exact path='/sign-in' element={<SigninPage />} />
      </Routes>
    </div>
  );
}

export default App;
